import React from 'react'
import text from './Assets/text.png'
import './content.css';
function Content() {
  return (
    <main>
      <div className='Bg'>
        <div className='text'>
          <img src = {text} alt = "Text"/>
          
        </div>
      </div>
    </main>
  );
}

export default Content
